import { useEffect, useState } from "react"

const useFetchData = (url)=>{
    const [data,setData] = useState({})
    const [loading,setLoading] = useState(true)

    useEffect(()=>{
        fetch(url)
        .then((data)=>{
            console.log(data);
            setData(data)
        })
        .catch((err)=>console.log(err))
    },[url])
    return {data,loading}
}
export default useFetchData
